pc.script.createLoadingScreen(function (app) {
    var showSplash = function () {
        // splash wrapper
        var wrapper = document.createElement('div');
        wrapper.id = 'application-splash-wrapper';
        document.body.appendChild(wrapper);

        // splash
        var splash = document.createElement('div');
        splash.id = 'application-splash';
        wrapper.appendChild(splash);
        splash.style.display = 'none';

        var logo = document.createElement('img');
        logo.src = ' data:image/png;base64,';
        splash.appendChild(logo);
        
        logo.onload = function () {
            splash.style.display = 'block';
        };
        logo.style.marginTop = "-50px";

        var container = document.createElement('div');
        container.id = 'progress-bar-container';
        splash.appendChild(container);
        container.style.marginTop = '50px';

        var percentageLoad = document.createElement('p');
        percentageLoad.id = "PercentageText";
        percentageLoad.innerHTML = "0%";
        percentageLoad.style.color = "#ffffff";
        percentageLoad.style.textAlign = "center";
        percentageLoad.style.fontSize = "34px";
        percentageLoad.style.fontWeight = "900"; 
        percentageLoad.marginTop ="-10px";
        container.appendChild(percentageLoad);

        var logo2 = document.createElement('img');
        logo2.src = ' data:image/png;base64,';
        splash.appendChild(logo2);
        logo2.style.marginTop = "150px";
        // logo2.style.width = "80%";
        var bar = document.createElement('div');
        bar.id = 'progress-bar';
        container.appendChild(bar);

    };

    var hideSplash = function () {
        var splash = document.getElementById('application-splash-wrapper');
        splash.parentElement.removeChild(splash);
    };

    var setProgress = function (value) {
        var bar = document.getElementById('progress-bar');
        var percText = document.getElementById('PercentageText');
        // bar.style.marginTop = "110%";
        if(bar) {
            value = Math.min(1, Math.max(0, value));
            bar.style.width = value * 100 + '%';
            percText.innerHTML = parseInt(value * 100) + '%';
        }
    };

    var createCss = function () {
        var css = [
            'body {',
            '    background-color: #082C3C;',
            '}',
            '',
            '#application-splash-wrapper {',
            '    position: absolute;',
            '    top: 0;',
            '    left: 0;',
            '    height: 100%;',
            '    width: 100%;',
            '    background-color: #082C3C;',
            '}',
            '',
            '#application-splash {',
            '    position: absolute;',
            '    top: calc(15%);',
            '    width: 400px;',
            '    left: calc(50% - 200px);',
            '}',
            '',
            '#application-splash img {',
            '    width: 100%;',
            '}',
            '',
            '#progress-bar-container {',
            '    margin: 20px auto 0 auto;',
            '    height: 2px;',
            '    width: 100%;',
            '    background-color: #1d292c;',
            '}',
            '',
            '#progress-bar {',
            '    width: 0%;',
            '    height: 100%;',
            '    background-color: #fff;',
            '}',
            '',
            '@media (max-width: 480px) {',
            '    #application-splash {',
            '        width: 170px;',
            '        left: calc(50% - 85px);',
            '    }',
            '}'
        ].join('\n');

        var style = document.createElement('style');
        style.type = 'text/css';
        if (style.styleSheet) {
            style.styleSheet.cssText = css;
        } else {
            style.appendChild(document.createTextNode(css));
        }

        document.head.appendChild(style);
    };

    createCss();
    showSplash();

    app.on('preload:end', function () {
        app.off('preload:progress');
    });
    app.on('preload:progress', setProgress);
    app.on('start', hideSplash);
});